@dhruvrathee
I don't know from which state you come , but for your knowledge  Bharath derives its name from the  routes of  sanathana Dharma ( hinduism). Where were  Muslim ,Christianity and others there was only one that was/ is hinduism . Not to take it personal, say your father is involved  in some  unlawful activity should we blame you? While Modi is working for the betterment of Dharma and nation but some of the workers of the party do something wrong is he supposed to be blamed?  Coming to the  mutton and beef allegations you have made , I request you to do some homework on economics,its impact on export, GDP growth , the nation's to which it is  being exported and what would be the implications on the country if they do not cater to the needs. Think about all of these issues at the national level and not at your IQ level. Don't make fabricated speeches for  views rather make it for the betterment of the nation.
If you have suggestions and ideas then  contest in an election,  understand the process practically and if possible WIN .

@dhruvrathee putting all the arti facts explained all pros ..

